class Solution {
    func minSum(_ nums1: [Int], _ nums2: [Int]) -> Int {
        let totalZeros1 = nums1.filter { $0 == 0 }.count
        let totalZeros2 = nums2.filter { $0 == 0 }.count
        let sum1 = nums1.reduce(0, +)
        let sum2 = nums2.reduce(0, +)

        if totalZeros1 == 0 && totalZeros2 == 0 {
            return sum1 == sum2 ? sum1 : -1
        }

        let targetSum = max(sum1, sum2) + abs(sum1 - sum2) / max(1, totalZeros1 + totalZeros2) * max(totalZeros1, totalZeros2)
        if (sum1 + totalZeros1 - sum2) % max(1, totalZeros2) == 0 || (sum2 + totalZeros2 - sum1) % max(1, totalZeros1) == 0 {
            return targetSum
        }

        return -1
    }
}
